import React from "react";
import { Navbar, Nav, Container } from "react-bootstrap";
import logo from "../logo.png"; // đường dẫn đến logo bạn đã lưu

const NavigationBar = () => {
  return (
    <Navbar expand="lg" bg="white" className="shadow-sm">
      <Container>
        {/* Logo */}
        <Navbar.Brand href="/">
          <img src={logo} alt="BC Cinema" style={{ height: "50px" }} />
        </Navbar.Brand>

        {/* Các menu */}
        <Nav className="ms-auto fw-bold">
          <Nav.Link href="#movies">Phim</Nav.Link>
          <Nav.Link href="#food">Đồ ăn & thức uống</Nav.Link>
          <Nav.Link href="#promotions">Ưu đãi & khuyến mãi</Nav.Link>
          <Nav.Link href="#members">Thành viên</Nav.Link>
        </Nav>
      </Container>
    </Navbar>
  );
};

export default NavigationBar;
